// Make Header Component
export default function Header() {
  return (
    <header className="header">
      <nav className="navbar">
        <img
          src={require("./react-logo.png")}
          alt="react-logo"
          className="nav-logo"
        />
        <strong>
          <ul className="nav-items">
            <li>Pricing</li>
            <li>About</li>
            <li>Contact</li>
          </ul>
        </strong>
      </nav>
    </header>
  );
}
